import './App.css';
import React from 'react';
import { Form , Input , Button } from 'antd';
import FormItem from 'antd/es/form/FormItem';



function App() {

  const Header = (props) => {

    let color = ''; 

    switch(props.type) {
      case 'SUMBMIT':
      color = 'green';
      break;
      case 'vb':
      color = 'red';
      break;
      case 'nh':
      color = 'blue';
      break;
      default:
        color =""
    }

return (
  <Button style={{background:color}}>{props.man}</Button>
)
  }


  return (
    <div className="App">
     <Form>
      <FormItem label="User Name" name ="username">
        <Input placeholder='User Name' required></Input>
      </FormItem>
      <FormItem label="Password" name ="password">
        <Input placeholder='Password 'required></Input>
      </FormItem>
      <FormItem>
        <Button block type='primary' >Log in</Button>
        <Button block type='vb' >Cancel</Button>
        </FormItem>
     </Form>

     <Header man ="Go" type="SUMBMIT"/>

     <Header man ="stop" type="vb"/>

     <Header man ="go fast" type="nh"/>



    </div>
  );
}

export default App;
